	grid.name = "GRID"
	grid.position.y = 0;

//	scene.add( grid );

	return grid;
}

axisCustomHelper = new THREE.Group();

axisCustomHelper.add.apply( this, CustomAxisHelper(5200) );

scene.add( axisCustomHelper );

//	constractor.

function CustomAxisHelper( distance ){

	var geometryX = new THREE.Geometry();
	var geometryY = new THREE.Geometry();
	var geometryZ = new THREE.Geometry();

	var materialX = new THREE.LineBasicMaterial( {color: 0xff0000} );
	var materialY = new THREE.LineBasicMaterial( {color: 0x00ff00} );
	var materialZ = new THREE.LineBasicMaterial( {color: 0x0000ff} );

	geometryX.vertices.push( new THREE.Vector3( -distance, 0, 0 ), new THREE.Vector3( distance, 0, 0 ) );
	geometryY.vertices.push( new THREE.Vector3( 0, -distance, 0 ), new THREE.Vector3( 0, distance, 0 ) );
	geometryZ.vertices.push( new THREE.Vector3( 0, 0, -distance ), new THREE.Vector3( 0, 0, distance ) );

	var axisX = new THREE.Line( geometryX, materialX );
	var axisY = new THREE.Line( geometryY, materialY );
	var axisZ = new THREE.Line( geometryZ, materialZ );

	return [ axisX, axisZ ];

}

axisOriginHelper = new THREE.Group();
axisOriginHelper.distance = 1200;

var loader = new THREE.FontLoader();
var url = "/three/fonts/helvetiker_regular.typeface.json";

loader.load( url, function ( response ) {

	var font = response;
	var distance = axisOriginHelper.distance;

//  Font Material
	var materialFace = new THREE.MeshBasicMaterial( { color: 0xffffff } );
	var materialSide = new THREE.MeshBasicMaterial( { color: 0x888888 } );
	var material = new THREE.MeshFaceMaterial([ materialFace, materialSide ]);

//  Text Styles.
	var h0 = { size: 40, height: 2,   curveSegments: 10, font: font, weight: "normal", style: "normal", bevelThickness: 1, bevelSize: 2, bevelEnabled: false, material: 0, extrudeMaterial: 1 }
	var h1 = { size: 20, height: 1,   curveSegments: 10, font: font, weight: "normal", style: "normal", bevelThickness: 1, bevelSize: 2, bevelEnabled: false, material: 0, extrudeMaterial: 1 }
	var h2 = { size: 10, height: 1,   curveSegments: 10, font: font, weight: "normal", style: "normal", bevelThickness: 1, bevelSize: 2, bevelEnabled: false, material: 0, extrudeMaterial: 1 }
	var h3 = { size: 5,  height: 0.5, curveSegments: 10, font: font, weight: "normal", style: "normal", bevelThickness: 1, bevelSize: 2, bevelEnabled: false, material: 0, extrudeMaterial: 1 }

//  Origins Group.
	axisOriginHelper.add( new Text3D( "+x", h1, [2, 2, 5], [ distance, 20, 0], [0, -Math.PI * 0.5, 0]) );
	axisOriginHelper.add( new Text3D( "-x", h1, [2, 2, 5], [-distance, 20, 0], [0,  Math.PI * 0.5, 0]) ); 
	axisOriginHelper.add( new Text3D( "+z", h1, [2, 2, 5], [0, 20,  distance], [0, -Math.PI,       0]) ); 
	axisOriginHelper.add( new Text3D( "-z", h1, [2, 2, 5], [0, 20, -distance], [0,              0, 0]) ); 
	axisOriginHelper.add( new Text3D( "+y", h1, [2, 2, 5], [0,   distance, 0], [ Math.PI * 0.5, 0, 0]) ); 
	axisOriginHelper.add( new Text3D( "-y", h1, [2, 2, 5], [0,  -distance, 0], [-Math.PI * 0.5, 0, 0]) ); 

	scene.add( axisOriginHelper );

	function Text3D(text, style, scale, position, rotation){
		var geometry = new THREE.TextGeometry( text, style );
		var mesh = new THREE.Mesh(geometry, material );
		geometry.computeBoundingBox();
		var width = geometry.boundingBox.max.x - geometry.boundingBox.min.x;
		mesh.scale.fromArray( scale ); 
		mesh.geometry.center();
		mesh.position.fromArray( position );
		mesh.rotation.fromArray( rotation );
		return mesh;
	}

});

