function _max(){
	return this.length - 1;
};

function _get_index(){
	return this.index;
};

function _get(){
	return this[ this.getIndex() ] || null;
};

function _get_name(){
	return ( this.get() && this.get().name ) || "";
};

function _get_object(){
	return {"body": this.get()};
};

function _set_index(i){

	var i = parseInt(i);

	if ( isNaN(i) )
		this.index = 0; 
	else if ( i < 0 ) 
		this.index = 0;
	else if ( i > max)
		this.index = max;
	else 
		this.index = i;

	return this;
};

function _set( mesh ){

	if ( !mesh.type ) return null;
	if ( mesh.type != "SkinnedMesh" ) return null;

	var index = this.findIndex(function(item){
		return item.uuid == mesh.uuid;
	});

	if ( index < 0 ) {
		this.push( mesh );
